import logo from './logo.svg';
import './App.css';

const arrayBlook = [
    {
      nameItem: "кросовки",
        model: "Адидас"

    },
    {
        nameItem: "кросовки",
        model: "Адидас"
    },
    {
        nameItem: "кросовки",
        model: "ребук"
    }
]

function App() {
  return (
    <div className="App">

        <header className={"header"}>

        </header>
        <main className="main">
            <div className="shop-title">
            <p>кросовки</p>
            <p>одежда</p>
        </div>
            <div className="shop-title">
            <p>кросовки</p>
            <p>одежда</p>
        </div>
            {
                arrayBlook.map((item) => (
                    <div className="shop-title">
                        <p>{item.nameItem}</p>
                        <p>{item.model}</p>
                    </div>
                ))
            }
        </main>
    </div>
  )
}

export default App;
